/**
  * Box-sizing:
  * Setting box-sizing to border-box
  * css-tricks.com/inheriting-box-sizing-probably-slightly-better-best-practice
*/

html {
  box-sizing: border-box;
}
  
* {
  &,
  &::before,
  &::after {
    box-sizing: inherit;
  }
}

